import { useState } from "react";
import React from "react";
import Forms from "./Forms";

function Profiles({users, setSelectedUserId}) {

  const uniqueUsers = Array.from(new Set(users.map(user => user.userId)))
    .map(userId => users.find(user => user.userId === userId));

  const handleClick = (userId) => {
    setSelectedUserId(userId);
  };

  return (
    <div className="profiles">
      <h1>Select a ptofile</h1>
      <ul>
      {uniqueUsers.map(user => {
        return(
        <li onClick={() =>handleClick(user.userId)} key={user.id}>{user.userId}</li> 
        );
      })}
      </ul>
    </div>
  );
}

export default Profiles;
